import React from "react";
import Trade from "./components/Trade";

function App() {
  return (
    <div style={{ padding: "2rem", fontFamily: "Arial" }}>
      <h1>CoinDCX Trading Platform</h1>
      <Trade />
    </div>
  );
}

export default App;
